class Square extends Component {

handleClick = () => {
    if(this.props.counter > 0 && this.props.userStatus === ""){
    this.props.handleLocation(this.props.index)
  }
}

  render() {


    return (
     <div id="square" onClick = {this.handleClick}>
        {this.props.value}
      </div>
    );
  }
}


export default Square
